import React from 'react';
import { Box, Typography, TextField, FormControlLabel, Checkbox, Button, Stack } from '@mui/material';
import { HealthAndSafety, LocalHospital, RestaurantMenu } from '@mui/icons-material';
import { useRecipeContext } from '../context/RecipeContext';

const HealthProfile = () => {
  const { healthProfile, updateHealthProfile, getRecommendations } = useRecipeContext();

  const handleChange = (e) => {
  const { name, value, type, checked } = e.target;
  
  updateHealthProfile({
    [name]: type === 'checkbox' ? checked : value
  });
};

  return (
    <Box 
      sx={{ 
        mb: 4, 
        p: { xs: 3, md: 4.5 }, 
        borderRadius: 3,
        backgroundColor: 'background.paper',
        boxShadow: '0 8px 32px rgba(0, 0, 0, 0.1), 0 2px 8px rgba(0, 0, 0, 0.05)',
        border: '1px solid rgba(255, 255, 255, 0.8)',
        backdropFilter: 'blur(10px)',
        position: 'relative',
        overflow: 'hidden',
        '&::before': {
          content: '""',
          position: 'absolute',
          top: 0,
          left: 0,
          right: 0,
          height: '4px',
          background: 'linear-gradient(90deg, #667eea 0%, #764ba2 50%, #f093fb 100%)',
          backgroundSize: '200% 100%',
          animation: 'gradientShift 3s ease infinite',
        },
      }}
    >
      <Stack direction="row" alignItems="center" spacing={2} sx={{ mb: 3 }}>
        <Box
          sx={{
            p: 1.5,
            borderRadius: '12px',
            background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            boxShadow: '0 4px 12px rgba(102, 126, 234, 0.3)',
          }}
        >
          <HealthAndSafety sx={{ fontSize: 28, color: 'white' }} />
        </Box>
        <Typography 
          variant="h5" 
          sx={{ 
            fontWeight: 800,
            color: 'text.primary',
            letterSpacing: '-0.01em',
          }}
        >
          Health Profile
        </Typography>
      </Stack>
      
      <TextField
        fullWidth
        label="Daily Sodium Limit (mg)"
        name="dailySodiumMax"
        type="number"
        value={healthProfile.dailySodiumMax}
        onChange={handleChange}
        margin="normal"
        InputProps={{ inputProps: { min: 500, max: 3000 } }}
        sx={{ mb: 3 }}
      />
      
      <Box 
        sx={{ 
          mb: 3,
          p: 2,
          borderRadius: '12px',
          backgroundColor: 'grey.50',
          border: '1px solid',
          borderColor: 'grey.200',
        }}
      >
        <FormControlLabel
          control={
            <Checkbox
              name="hasDiabetes"
              checked={healthProfile.hasDiabetes}
              onChange={handleChange}
              sx={{ 
                '&.Mui-checked': {
                  color: 'primary.main',
                }
              }}
            />
          }
          label={
            <Stack direction="row" alignItems="center" spacing={1}>
              <LocalHospital sx={{ fontSize: 20, color: 'text.secondary' }} />
              <Typography sx={{ fontWeight: 500 }}>I have diabetes</Typography>
            </Stack>
          }
          sx={{ display: 'block', mb: 2 }}
        />
        
        <FormControlLabel
          control={
            <Checkbox
              name="hasRenalDisease"
              checked={healthProfile.hasRenalDisease}
              onChange={handleChange}
              sx={{ 
                '&.Mui-checked': {
                  color: 'primary.main',
                }
              }}
            />
          }
          label={
            <Stack direction="row" alignItems="center" spacing={1}>
              <HealthAndSafety sx={{ fontSize: 20, color: 'text.secondary' }} />
              <Typography sx={{ fontWeight: 500 }}>I have kidney disease</Typography>
            </Stack>
          }
          sx={{ display: 'block' }}
        />
      </Box>
      
      <Button 
        variant="contained" 
        color="primary"
        onClick={getRecommendations}
        fullWidth
        size="large"
        startIcon={<RestaurantMenu />}
        sx={{ 
          mt: 2,
          py: 1.75,
          fontSize: '1.1rem',
          fontWeight: 700,
        }}
      >
        Get Recommendations
      </Button>
    </Box>
  );
};

export default HealthProfile;
